package s0;

public class Constructorcall1 {
	
	int a,b,c,d,e;
	
	public Constructorcall1(int f,int g,int h,int i,int j)
	{
		a=f;
		b=g;
		c=h;
		d=i;
		e=j;
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		Constructorcall1 cc1=new Constructorcall1(10,20,30,40,50);
		System.out.println(cc1.a);
		System.out.println(cc1.b);
		System.out.println(cc1.c);
		System.out.println(cc1.d);
		System.out.println(cc1.e);
		
		
		
		
		

	}
}



